import React from 'react';
import './FeaturesSection.css';
import Voice from '../../Media/vocie-interactive.png';

const FeaturesSection = () => {
  return (
    <section>
      <h1>Features of Kyan</h1>
      <div className="feature-list">
        <div className="feature">
          <img src="../../Media/voice-interactive.jpeg" alt="Voice Interactive" />
          <h3>Voice Interactive</h3>
        </div>
        <div className="feature">
          <img src="images/LerningTechniques.jpeg" alt="Learning Techniques" />
          <h3>Learning Techniques</h3>
        </div>
        <div className="feature">
          <img src="images/focus.jpeg" alt="Focus Tracking" />
          <h3>Focus Tracking</h3>
        </div>
        <div className="feature">
          <img src="images/sentiment.jpeg" alt="Sentiment Understanding" />
          <h3>Understands Sentiment</h3>
        </div>
      </div>
    </section>
  );
};

export default FeaturesSection;
